window.bookSummaryJSON = "<p><b>Contains </b><b><i>Curse of Agares</i></b><b> (book five) and </b><b><i>Forbidden Region</i></b><b> (book six) of the Legend of the Arch Magus series.</b></p> <p>An arch magus dies, only to find himself in the body of a young man in a medieval kingdom. He finds out that he is the second son of a duke, exiled to a desolated town by his own family. Shackled by the notorious reputation of his new shell, he tries his best to develop his domain, implementing new policies and innovations, leading his subjects to prosperity. In this world where magic is undeveloped, he shall once again pave a new path.</p>"; 
